export default class Home extends React.Component {

    constructor(props) {
        super(props);
        this.state= {
            name: "",
            post: {},
            summoner_infos: [{},{}],
            summoner_id: '',
            summoner_account_id: '',
            status: 0,
            error_message: null,
            body: null,
            icon_url: '',
            summoners:[]
        };

    const APICall = "https://euw1.api.riotgames.com/lol/summoner/v4/summoners/by-name/" + players[0] + API_KEY;
    fetch(APICall).then((response) => {
        console.log(response);
        return response.json();

    }) .then((result) => {
        console.log('res', result)
        if (result.status) {
            this.setState({ status: result.status.status_code })
        } else {
            this.setState({status: 0})
        }
        this.setState({ summoner_id: result.id, summoner_account_id: result.accountId, post: result });
        //icon
        this.setState({ icon_url: 'http://ddragon.leagueoflegends.com/cdn/10.13.1/img/profileicon/' + result.profileIconId + '.png' })
        if (this.state.status === 0) {
            fetch('https://euw1.api.riotgames.com/lol/league/v4/entries/by-summoner/' + this.state.summoner_id + API_KEY)
                .then((response) => {
                    return response.json()
                })
                .then((result) => {
                    console.log('res is : ', result)
                    this.setState({ summoner_infos: result })
                })
        } else {
            console.log(this.state.status)
        }
        const tab = [
            createData("Alvyn",45, 6.0, 24, 4.0),
            createData('Ice da sandwich', 237, 9.0, 37, 4.3),
            createData('Ecdawdwalair', 262, 16.0, 24, 6.0),
            createData('Cupwdaawacake', 305, 3.7, 67, 4.3),
            createData('Gingedawdwarbread', 356, 16.0, 49, 3.9), 
          ];
    });

    }


    render() {
      /*  for (var i = 0; i < players.length; i++) {
            this.player.name = players[i];
            var tmp = searchPlayer(players[i]);

            console.log("test  " + players[i] + "  "+  tmp);
            //this.player.summoner_id = tmp.id;
            //this.summoner_account_id= tmp.accountId;
            //tmp = getPlayerDatas(tmp);
            console.log(tmp);
        }*/
        const { name, summoner_infos, icon_url, error_message, body } = this.state;
    return (
        <Page title="Ranking">
                <Container>
                    <TableContainer component={Paper} >
       <Table sx={{ minWidth: 650 ,bgcolor: '#2F4F4F'}} aria-label="simple table">
        <TableHead>
          <TableRow >
            <TableCell sx={{ color: 'white'}}>Player</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">Summoner Name</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">Rank</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">W</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">L</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">WR</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ 'td, th': { border: 0, color: 'white' } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              {this.state.summoner_account_id}
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell>
            </TableRow>

          ))}
        </TableBody>
      </Table>
    </TableContainer>
    <aside>
            {this.tab.name}
                    { summoner_infos[0] ? summoner_infos[0].queueType : null }<br/>
                    <p>{ summoner_infos[0] ? summoner_infos[0].tier : null } { summoner_infos[0] ? summoner_infos[0].rank : null }</p>
                    { summoner_infos[0].leaguePoints ? <p>{ summoner_infos[0] ? summoner_infos[0].leaguePoints : null } lp</p> : null }
                    {( summoner_infos[0] && summoner_infos[0].wins && summoner_infos[0].losses) ? <p>{ summoner_infos[0].wins }V { summoner_infos[0].losses }L</p> : null }
                    <br></br>
                    <br></br>
                    { summoner_infos[1] ? summoner_infos[1].queueType : null }<br/>
                    <p>{ summoner_infos[1] ? summoner_infos[1].tier : null } { summoner_infos[1] ? summoner_infos[1].rank : null }</p>
                    { (summoner_infos[1] && summoner_infos[1].leaguePoints) ? <p>{summoner_infos[1].leaguePoints } lp</p> : null }
                    { (summoner_infos[1] && summoner_infos[1].wins && summoner_infos[1].losses) ? <p>{ summoner_infos[1].wins }V {summoner_infos[1].losses }L</p> : null }
                    { error_message ? error_message : null }
                    { body }
                </aside>
                </Container>
        </Page>
    )
}
}
